// src/components/NavBar.js
import React, { useContext, useState } from 'react';
import { FaSearch, FaUser, FaShoppingCart } from 'react-icons/fa';
import { CartContext } from '../context/CartContext';
import { AuthContext } from '../context/AuthContext';
import { useNavigate } from 'react-router-dom';
import { Offcanvas, Button, Form } from 'react-bootstrap';
import logo from '../assets/images/squareLogo.svg';

const Navbar = () => {
    const { getItemCount, cartItems } = useContext(CartContext);
    const { auth } = useContext(AuthContext);
    const navigate = useNavigate();
    const [showCart, setShowCart] = useState(false);
    const [showSearch, setShowSearch] = useState(false);

    // Toggle visibility for cart and search windows
    const handleCartClose = () => setShowCart(false);
    const handleCartShow = () => setShowCart(true);
    const handleSearchClose = () => setShowSearch(false);
    const handleSearchShow = () => setShowSearch(true);

    const handleUserIconClick = () => {
        if (auth?.token) {
            navigate('/vendor-dashboard'); // Redirect to vendor dashboard if logged in
        } else {
            navigate('/sign-in'); // Redirect to sign-in if not logged in
        }
    };

    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light shadow-sm">
            <div className="container-fluid">
                {/* Logo - Navigate to home on click */}
                <a className="navbar-brand" href="#" onClick={() => navigate('/')}>
                    <img src={logo} alt="Logo" width="50px" className="d-inline-block align-text-top" />
                </a>

                <div className="d-flex align-items-center">
                    {/* Search Icon */}
                    <a href="#" className="nav-link me-3" onClick={handleSearchShow}>
                        <FaSearch size={20} />
                    </a>

                    {/* User Icon */}
                    <a href="#" className="nav-link me-3" onClick={handleUserIconClick}>
                        <FaUser size={20} />
                    </a>

                    {/* Shopping Cart Icon with item count */}
                    <div className="nav-item me-3">
                        <a href="#" className="nav-link position-relative" onClick={handleCartShow} role="button">
                            <FaShoppingCart size={20} />
                            {getItemCount() > 0 && (
                                <span className="badge bg-danger position-absolute top-0 start-100 translate-middle" style={{ fontSize: '0.8rem' }}>
                                    {getItemCount()}
                                </span>
                            )}
                        </a>
                    </div>
                </div>
            </div>

            {/* Offcanvas Search */}
            <Offcanvas show={showSearch} onHide={handleSearchClose} placement="end">
                <Offcanvas.Header closeButton>
                    <Offcanvas.Title>Search</Offcanvas.Title>
                </Offcanvas.Header>
                <Offcanvas.Body>
                    <Form>
                        <Form.Group controlId="search">
                            <Form.Label>Search for products or vendors</Form.Label>
                            <Form.Control
                                type="text"
                                placeholder="Enter keywords"
                            />
                        </Form.Group>
                        <Button variant="primary" className="mt-3 w-100" onClick={() => alert('Search functionality here')}>
                            Search
                        </Button>
                    </Form>
                </Offcanvas.Body>
            </Offcanvas>

            {/* Offcanvas Cart */}
            <Offcanvas show={showCart} onHide={handleCartClose} placement="end">
                <Offcanvas.Header closeButton>
                    <Offcanvas.Title>Your Cart</Offcanvas.Title>
                </Offcanvas.Header>
                <Offcanvas.Body>
                    {cartItems.length > 0 ? (
                        cartItems.map((item, index) => (
                            <div key={index} className="d-flex justify-content-between mb-2">
                                <span>{item.name}</span>
                                <span>{item.quantity} x ${item.price}</span>
                            </div>
                        ))
                    ) : (
                        <p>Your cart is empty.</p>
                    )}
                    <Button variant="primary" className="w-100 mt-3" onClick={() => navigate('/checkout')}>
                        Checkout
                    </Button>
                </Offcanvas.Body>
            </Offcanvas>
        </nav>
    );
};

export default Navbar;
